import { Home } from "./pages/Home.jsx";
import { Order } from './pages/Order.jsx';
import { CompleteOrder } from './pages/CompleteOrder.jsx'
// import { About } from "./pages/util/About.jsx";
// import { NameApp } from "./pages/name/NameApp.jsx";

export const routes = [
    {
      path: "/home",
      component: Home,
    },
    {
        path: "/order",
        component: Order,
    },
    {
      path: "/completeorder",
      component: CompleteOrder,
    },
  ];
